import React, { useState } from 'react';
import {
  Grid,
  TextField,
  Typography,
  Button,
  Box
} from '@mui/material';

interface FormDataType {
  cnpj: string;
  razaoSocial: string;
  responsavelNome: string;
  responsavelCargo: string;
  responsavelTelefone: string;
  responsavelEmail: string;
  banco: string;
  agencia: string;
  agenciaDv: string;
  conta: string;
  contaDv: string;
  convenio: string;
  cnab: string;
  gerenteConta: string;
  gerenteTelefone: string;
  gerenteEmail: string;
}

const BankForm: React.FC<{ selectedBank?: { name: string } }> = ({ selectedBank }) => {
  const [formData, setFormData] = useState<FormDataType>({
    cnpj: '',
    razaoSocial: '',
    responsavelNome: '',
    responsavelCargo: '',
    responsavelTelefone: '',
    responsavelEmail: '',
    banco: selectedBank?.name || '',
    agencia: '',
    agenciaDv: '',
    conta: '',
    contaDv: '',
    convenio: '',
    cnab: '',
    gerenteConta: '',
    gerenteTelefone: '',
    gerenteEmail: '',
  });

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const isFormValid = () => {
    const requiredFields = [
      'cnpj',
      'razaoSocial',
      'responsavelNome',
      'responsavelCargo',
      'responsavelTelefone',
      'responsavelEmail',
      'agencia',
      'agenciaDv',
      'conta',
      'contaDv',
      'convenio',
      'cnab',
      'gerenteConta',
      'gerenteTelefone',
      'gerenteEmail',
    ];
    return requiredFields.every(
      (field) => formData[field as keyof FormDataType]?.trim() !== ''
    );
  };

  return (
    <Box sx={{ p: 4 }}>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6}>
          <TextField
            required
            fullWidth
            label="CNPJ"
            name="cnpj"
            value={formData.cnpj}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            required
            fullWidth
            label="Razão Social"
            name="razaoSocial"
            value={formData.razaoSocial}
            onChange={handleChange}
          />
        </Grid>

        <Grid item xs={12} sm={6}>
          <TextField
            required
            fullWidth
            label="Nome do Responsável"
            name="responsavelNome"
            value={formData.responsavelNome}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            required
            fullWidth
            label="Cargo"
            name="responsavelCargo"
            value={formData.responsavelCargo}
            onChange={handleChange}
          />
        </Grid>

        <Grid item xs={12} sm={6}>
          <TextField
            required
            fullWidth
            label="Telefone"
            name="responsavelTelefone"
            value={formData.responsavelTelefone}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            required
            fullWidth
            label="Email"
            name="responsavelEmail"
            value={formData.responsavelEmail}
            onChange={handleChange}
          />
        </Grid>

        <Grid item xs={12} sm={4}>
          <TextField
            required
            fullWidth
            label="Agência"
            name="agencia"
            value={formData.agencia}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={2}>
          <TextField
            required
            fullWidth
            label="DV"
            name="agenciaDv"
            value={formData.agenciaDv}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={4}>
          <TextField
            required
            fullWidth
            label="Conta"
            name="conta"
            value={formData.conta}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={2}>
          <TextField
            required
            fullWidth
            label="DV"
            name="contaDv"
            value={formData.contaDv}
            onChange={handleChange}
          />
        </Grid>

        <Grid item xs={12} sm={6}>
          <TextField
            required
            fullWidth
            label="Convênio"
            name="convenio"
            value={formData.convenio}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle1" sx={{ mb: 1 }}>
            CNAB
          </Typography>
          <Box sx={{ display: 'flex', gap: 2 }}>
            {['240', '400', '444'].map((value) => (
              <Button
                key={value}
                variant={formData.cnab === value ? 'contained' : 'outlined'}
                onClick={() => setFormData((prev) => ({ ...prev, cnab: value }))}
              >
                {value}
              </Button>
            ))}
          </Box>
        </Grid>

        <Grid item xs={12} sm={6}>
          <TextField
            required
            fullWidth
            label="Gerente da Conta"
            name="gerenteConta"
            value={formData.gerenteConta}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={3}>
          <TextField
            required
            fullWidth
            label="Telefone do Gerente"
            name="gerenteTelefone"
            value={formData.gerenteTelefone}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={3}>
          <TextField
            required
            fullWidth
            label="Email do Gerente"
            name="gerenteEmail"
            value={formData.gerenteEmail}
            onChange={handleChange}
          />
        </Grid>
      </Grid>

      <Box mt={4}>
        <Button
          variant="contained"
          color="primary"
          disabled={!isFormValid()}
        >
          Enviar
        </Button>
      </Box>
    </Box>
  );
};

export default BankForm;
